import styled from "styled-components"
import MainTopNavContainer from "./Components/Container/MainTopNavContainer"

const BackDiv = styled.div`
    display: flex;
    align-items: center;
    justify-content: center;

    width: 100%;
    height: 100%;
`

const Main = () => {
    return (
        <BackDiv>
            <MainTopNavContainer />
        </BackDiv>
    )
}

export default Main;
